(* ::Subsection:: *)
(*PlotChromatographyMassSpectra*)

DefineTests[PlotChromatographyMassSpectra,{
	(*** Basic ***)
	Example[{Basic,"Visualize the changing mass spectrum in LCMS data as a function of elution time:"},
		PlotChromatographyMassSpectra[Object[Data, ChromatographyMassSpectra, "id:lYq9jRxPZzpl"]],
		ValidGraphicsP[]
	],
	Example[{Basic,"Plot the average mass spectra at specified elution times:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:lYq9jRxPZzpl"],
			PlotType->MassSpectrum,
			MassSpectrumTimeRange->{
				3.2 Minute;;3.6 Minute,
				4.6 Minute;;5.0 Minute
			}
		],
		ValidGraphicsP[]
	],
	Example[{Basic,"Plot extracted ion chromatograms for specific ranges of m/z:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:lYq9jRxPZzpl"],
			PlotType->ExtractedIonChromatogram,
			ExtractedIonMassRange->{
				154 Dalton;;164 Dalton,
				605 Dalton;;615 Dalton
			}
		],
		ValidGraphicsP[]
	],
	Example[{Basic,"PlotChromatographyMassSpectra is Listable:"},
		PlotChromatographyMassSpectra[{
			Object[Data, ChromatographyMassSpectra, "id:lYq9jRxPZzpl"],
			Object[Data, ChromatographyMassSpectra, "id:D8KAEvG6edeR"],
			Object[Data, ChromatographyMassSpectra, "id:Vrbp1jK43KXb"]
		}],
		{ValidGraphicsP[]..}
	],

	(*** Options ***)
	Example[{Options,DownsampledData,"Explicitly specify which downsampling analysis object linked to the input to use for plotting. Automatic defaults to the most recent downsampling analysis:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:M8n3rx08xD18"],
			PlotType -> AbsorbanceChromatogram,
			DownsampledData -> Object[Analysis, Downsampling, "id:XnlV5jKVKbpZ"]
		],
		ValidGraphicsP[]
	],
	Example[{Options,DownsampledData,"Plot raw data instead of downsampled data by setting DownsampledData to None, for example if the input data is not evenly spaced and cannot be downsampled:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:pZx9jo8JoG4P"],
			DownsampledData -> None
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Plot the absorbance chromatogram collected alongside LCMS data:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->AbsorbanceChromatogram
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Plot the total ion current (TIC), the total mass spectrum intensity at each time point:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:pZx9jo8VLAle"],
			PlotType->TotalIonCurrent
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Plot the base peak chromatogram (BPC), the maximum mass spectrum intensity at each time point:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:Vrbp1jKw6odO"],
			PlotType->BasePeakChromatogram
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Plot the average mass spectrum (MS) between 2.0 and 2.5 minute elution times:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:Vrbp1jKw6odO"],
			PlotType -> MassSpectrum,
			MassSpectrumTimeRange -> {2 Minute ;; 2.5 Minute},
			PlotRange -> {{500, 3000}, All},
			Zoomable -> False
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Plot the extracted ion chromatogram (EIC) of average intensity for m/z between 685 and 688:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:Vrbp1jKw6odO"],
			PlotType->ExtractedIonChromatogram,
			ExtractedIonMassRange->{
				685Dalton;;688Dalton
			}
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Generate a waterfall plot showing the evolution of mass spectra as a function of elution time:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->WaterfallPlot,
			ExcludeRange->{50Dalton;;70Dalton}
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Generate a multiple reaction monitoring mass chromatogram:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra, "id:dORYzZRVM45w"],
			PlotType->ReactionMonitoringMassChromatogram
		],
		ValidGraphicsP[]
	],
	Example[{Options,PlotType,"Generate a multiple reaction monitoring mass chromatogram without specifying plot type if data acquisition mode is MultipleReactionMonitoring:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra, "id:dORYzZRVM45w"]],
		ValidGraphicsP[]
	],
	Example[{Options,ExtractedIonMassRange,"By default, ExtractedIonMassRange will default to the entire range of m/z, producing a plot equivalent to the TotalIonCurrent:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:Vrbp1jKw6odO"],
			PlotType->ExtractedIonChromatogram
		],
		ValidGraphicsP[]
	],
	Example[{Options,ExtractedIonMassRange,"Specify a list of one or more m/z ranges:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:Vrbp1jKw6odO"],
			PlotType->ExtractedIonChromatogram,
			ExtractedIonMassRange->{
				663Dalton;;666Dalton,
				685Dalton;;688Dalton,
				1420Dalton;;1440Dalton
			}
		],
		ValidGraphicsP[]
	],
	Example[{Options,ExtractedIonReductionFunction,"Specify the function by which slices of m/z should be reduced into a single trace. Here, track the maximal intensity at each time point for the given ranges of m/z:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:Vrbp1jKw6odO"],
			PlotType->ExtractedIonChromatogram,
			ExtractedIonMassRange->{
				663Dalton;;666Dalton,
				685Dalton;;688Dalton,
				1420Dalton;;1440Dalton
			},
			ExtractedIonReductionFunction->Max
		],
		ValidGraphicsP[]
	],
	Example[{Options,MassSpectrumTimeRange,"By default, MassSpectrumTimeRange will default to the entire time range and the mass spectrum will reflect the average intensity across all time points:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:Vrbp1jKw6odO"],
			PlotType -> MassSpectrum,
			PlotRange -> {{500, 3000}, All},
			Zoomable->False
		],
		ValidGraphicsP[]
	],
	Example[{Options,MassSpectrumTimeRange,"Specify a list of one or more time ranges to extract mass spectra from:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:Vrbp1jKw6odO"],
			PlotType -> MassSpectrum,
			MassSpectrumTimeRange -> {2 Minute ;; 2.5 Minute, 4.5 Minute ;; 5.0 Minute},
			PlotRange -> {{500, 3000}, All},
			Zoomable->False
		],
		ValidGraphicsP[]
	],
	Example[{Options,MassSpectrumReductionFunction,"Specify the function by which slices across a time range should be reduced into a single trace. Here, we take the maximal intensity at each m/z for the given time range:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:Vrbp1jKw6odO"],
			PlotType -> MassSpectrum,
			MassSpectrumTimeRange -> {2 Minute ;; 2.5 Minute},
			MassSpectrumReductionFunction -> Max,
			PlotRange -> {{500, 3000}, All},
			Zoomable->False
		],
		ValidGraphicsP[]
	],
	Example[{Options,ShowNoiseThreshold,"Set ShowNoiseThreshold to True with PlotType of MassSpectrum to show the noise threshold (set during downsampling) below which intensity values are treated as zero:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx06AY5R"],
			PlotType->MassSpectrum,
			ShowNoiseThreshold->True,
			PlotRange->{{50,800},{0,3*10^7}}
		],
		ValidGraphicsP[]
	],
	Example[{Options,NumberOfWaterfallSlices,"By default, seven waterfall slices at evenly spaced time points are drawn when PlotType->WaterfallPlot:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->WaterfallPlot,
			ExcludeRange->{50Dalton;;70Dalton}
		],
		ValidGraphicsP[]
	],
	Example[{Options,NumberOfWaterfallSlices,"Draw only five waterfall slices:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->WaterfallPlot,
			NumberOfWaterfallSlices->5,
			ExcludeRange->{50Dalton;;70Dalton}
		],
		ValidGraphicsP[]
	],
	Example[{Options,Peaks,"Plot peaks picked from a mass spectrum. The plot will set PlotType and MassSpectrumTimeRange to match the peak-picking analysis automatically:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"Sample LCMS Data"],
			Peaks->massSpectrumPeaks
		],
		ValidGraphicsP[]
	],
	Test["Options are inherited from peaks object for peaks analysis on sliced MS:",
		Lookup[
			PlotChromatographyMassSpectra[
				Object[Data,ChromatographyMassSpectra,"Sample LCMS Data"],
				Peaks->massSpectrumPeaks,
				Output->Options
			],
			{PlotType,MassSpectrumTimeRange,MassSpectrumReductionFunction}
		],
		{MassSpectrum,{Quantity[3.2`,"Minutes"];;Quantity[3.5`,"Minutes"]},Mean}
	],
	Example[{Options,Peaks,"Plot peaks picked from an extracted ion chromatogram. The plot will set PlotType and ExtractedIonMassRange to match the peak-picking analysis automatically:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"Sample LCMS Data"],
			Peaks->extractedIonPeaks
		],
		ValidGraphicsP[]
	],
	Test["Options are inherited from peaks object for peaks analysis on sliced EIC:",
		Lookup[
			PlotChromatographyMassSpectra[
				Object[Data,ChromatographyMassSpectra,"Sample LCMS Data"],
				Peaks->extractedIonPeaks,
				Output->Options
			],
			{PlotType,ExtractedIonMassRange,ExtractedIonReductionFunction}
		],
		{ExtractedIonChromatogram,{Quantity[400,("Grams")/("Moles")];;Quantity[420,("Grams")/("Moles")]},Mean}
	],
	Example[{Options,WaterfallReferencePlot,"When available, PlotChromatographyMassSpectra will use the Absorbance chromatogram as a reference for elution time with PlotType->WaterfallPlot:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->WaterfallPlot,
			ExcludeRange->{50Dalton;;70Dalton}
		],
		ValidGraphicsP[]
	],
	Example[{Options,WaterfallReferencePlot,"Disable the waterfall plot reference by setting WaterfallReferencePlot to None:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->WaterfallPlot,
			ExcludeRange->{50Dalton;;70Dalton},
			WaterfallReferencePlot->None
		],
		ValidGraphicsP[]
	],
	Example[{Options,WaterfallReductionFunction,"By default, each waterfall represents the average of even slices of the input data on the time axis:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->WaterfallPlot,
			ExcludeRange->{50Dalton;;70Dalton},
			WaterfallReductionFunction->Mean
		],
		ValidGraphicsP[]
	],
	Example[{Options,WaterfallReductionFunction,"Generate a waterfall plot showing the maximum mass spectra intensities for evenly-spaced slices in time:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"id:M8n3rx08xD18"],
			PlotType->WaterfallPlot,
			ExcludeRange->{50Dalton;;70Dalton},
			WaterfallReductionFunction->Max
		],
		ValidGraphicsP[]
	],
	Example[{Options,ExcludeRange,"Specify one or more ranges of m/z values to exclude from a MassSpectrum plot:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:M8n3rx06AY5R"],
			PlotType -> MassSpectrum,
			ExcludeRange -> {0 Dalton ;; 150 Dalton}
		],
		ValidGraphicsP[]
	],
	Example[{Options,ExcludeRange,"Specify one or more ranges of m/z values to exclude from a waterfall plot:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:M8n3rx06AY5R"],
			PlotType -> WaterfallPlot,
			WaterfallReferencePlot -> None,
			ExcludeRange -> {0 Dalton;;300 Dalton, 500 Dalton;;700 Dalton}
		],
		ValidGraphicsP[]
	],
	Example[{Options,Map,"Set Map to True will plot all data in a protocol:"},
		PlotChromatographyMassSpectra[Object[Protocol, LCMS, "id:GmzlKjPwjW4m"][Data], Map->True],
		{ValidGraphicsP[]..}
	],

	(*** Messages ***)
	Example[{Messages,"WaterfallSidePlotMissing","Warning shows if a reference plot is requested that cannot be found, e.g. if the AbsorbanceChromatogram is requested for a data object with an empty Absorbance field:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:Vrbp1jKw6odO"],
			WaterfallReferencePlot -> AbsorbanceChromatogram
		],
		ValidGraphicsP[],
		Messages:>{Warning::WaterfallSidePlotMissing}
	],
	Example[{Messages,"MissingLCTrace","Error shows if the AbsorbanceChromatogram is requested from a data object with an empty Absorbance field:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:Vrbp1jKw6odO"],
			PlotType -> AbsorbanceChromatogram
		],
		$Failed,
		Messages:>{Error::MissingLCTrace,Error::InvalidInput}
	],
	Example[{Messages,"ReactionMonitoringDataNotFound","ReactionMonitoringMassChromatogram data is required for multiple reaction monitoring mass chromatogram plot. An error is thrown if the data object has an empty ReactionMonitoringMassChromatogram field:"},
		PlotChromatographyMassSpectra[
			Object[Data, ChromatographyMassSpectra, "id:Z1lqpMzkY3B9"],
			PlotType -> ReactionMonitoringMassChromatogram
		],
		$Failed,
		Messages:>{Error::ReactionMonitoringDataNotFound}
	],
	Example[{Messages,"InconsistentAcquisitionModes","An error is thrown if input data objects have inconsistent acquisition modes:"},
		PlotChromatographyMassSpectra[
			{
				Object[Data, ChromatographyMassSpectra,"id:P5ZnEjZXb37n"],
				Object[Data, ChromatographyMassSpectra, "id:zGj91a7M6Wxj"]
			}
		],
		$Failed,
		Messages:>{Error::InconsistentAcquisitionModes}
	],
	Example[{Messages,"AmbiguousData","An error is thrown if input data objects have ambiguous data:"},
	PlotChromatographyMassSpectra[{
