		Object[Data, ChromatographyMassSpectra,"Test object 2 for acquisition mode Unit Testing"]}],
		$Failed,
		Messages:>{Error::AmbiguousData}
	],
	Example[{Messages,"DownsampledDataNotFound","Downsampled data is required for plotting. If an object is missing downsampled data, please run AnalyzeDownsampling on it to precompute data for plotting:"},
