			Object[Data,ChromatographyMassSpectra,"Old object with no downsampling for Unit Testing"]
		],
		$Failed,
		Messages:>{Error::DownsampledDataNotFound,Error::InvalidInput}
	],
	Example[{Messages,"DownsampledDataNotReady","Downsampled data is required for plotting. Newly updated objects will be downsampled automatically by the ECL. Please check back later, or run AnalyzeDownsampling if results are needed immediately:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"New object with no downsampling for Unit Testing"]
		],
		$Failed,
		Messages:>{Error::DownsampledDataNotReady,Error::InvalidInput}
	],
	Example[{Messages,"DataFormat","Error and return $Failed if for some reason the linked Downsampled data file does not resolve to a sparse array:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"Object with invalid downsampling file for Unit Testing"]
		],
		$Failed,
		Messages:>{Error::DataFormat,Error::InvalidInput}
	],
	Example[{Messages,"InvalidDataDimensions","Error and return $Failed if for some reason the linked Downsampled data file has inconsistent dimensions with its sampling points:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"Object with invalid downsampled data dimensions for Unit Testing"]
		],
		$Failed,
		Messages:>{Error::InvalidDataDimensions,Error::InvalidInput}
	],

